import React from 'react';
import PropTypes from 'prop-types';
import { NavLink, withRouter } from 'react-router-dom';
import { NavDropdown } from 'react-bootstrap';
import { connect } from 'react-redux';

import {
  FOOTPRINTS_ROUTES,
  userSessionCookie,
  rememberUserCookie
} from '../../config';
import { logout } from '../../utils/authService';

import FootprintsLogoTransparent from '../../images/footprints-icon.svg';

import './Navbar.scss';
import ChangePassword from '../../containers/ChangePassword/ChangePassword';
import ACTIONS from '../../apiConfig/actions.constants';

const Navbar = props => {
  const onSignout = () => {
    logout(userSessionCookie, rememberUserCookie);
  };

  const toChangePassword = () => {
    props.dispatch({
      type: ACTIONS.PROFILE.SHOW_CHANGE_PASSWORD
    });
  };

  const footprintsBrand = (
    <NavLink to={props.logoLink} className="navbar-brand">
      <div className="d-flex flex-row align-items-center">
        <img className="logo-img" src={FootprintsLogoTransparent} alt="logo" />
        <div className="logo-text">Footprints</div>
      </div>
    </NavLink>
  );

  const userItem = (
    <NavDropdown
      title={props.userName}
      className="ml-auto nav-dropdown dropdown-menu-right"
      id="navbar-profile"
    >
      <NavDropdown.Item onClick={toChangePassword} id="navbar-change-password">
        Change Password
      </NavDropdown.Item>
      <NavDropdown.Item onClick={onSignout} id="navbar-logout">
        Logout
      </NavDropdown.Item>
    </NavDropdown>
  );

  return (
    <div className="fp-navbar">
      <nav
        className={`navbar sticky-top navbar-expand-lg navbar-light ${props.class}`}
      >
        {footprintsBrand}
        {userItem}
      </nav>
      <ChangePassword />
    </div>
  );
};

Navbar.propTypes = {
  class: PropTypes.string,
  userName: PropTypes.string,
  logoLink: PropTypes.string,
  dispatch: PropTypes.func.isRequired
};

Navbar.defaultProps = {
  class: 'nav-1',
  userName: 'User',
  logoLink: FOOTPRINTS_ROUTES.ANALYTICS
};

export default withRouter(
  connect(
    null,
    null
  )(Navbar)
);
